import Product from "../Component/Product"
import SideNavbar from "../Component/SideNavbar"



function Home() {

    return (
        <div style={{display:"flex", justifyContent:"space-between"}}>
            <div style={{width:"20%", marginTop:"100px"}}><SideNavbar /></div>
           <div style={{width:"80%",border:"1px solid black"}}> <Product /></div>
        </div>
    )

}

export default Home
